export const ChannelInfo = () => (
  <svg width='18' height='18' viewBox='0 0 18 18' fill='none' xmlns='http://www.w3.org/2000/svg'>
    <path
      fill='black'
      fillOpacity='0.33'
      circle cx="10" cy="10" r="2" fill="red"
    />
  </svg>
);
